import React from "react";
import "./shopBagItem.css";

function ShopBagItem({ game, index }) {
  return (
    <tr className="shopBagItem">
      <th scope="row">{index + 1}</th>
      <td>
        <img src="" alt="" />
      </td>
    </tr>
  );
}

export default ShopBagItem;
